import AdminPanel from "../pages/AdminPanel";
import Auth from "../pages/Auth";
import Panel from "../pages/Panel";
import { ADMINPANEL_ROUTE, AUTH_ROUTE, PANEL_ROUTE } from "../utils/constants";

export const AuthRoutes = [
    { path: PANEL_ROUTE, companent: Panel },
    { path: ADMINPANEL_ROUTE, companent: AdminPanel },
    { path: AUTH_ROUTE, companent: Auth },
]
